const CreateAccount = () => {
    return (
        <View className={"flex-1 flex-col "}>
            <Text>Tên zalo</Text>
            <TextInput placeholder="Gồm 2-40 kí tự"></TextInput>
            <View>'
                <Text>Lưu ý khi đặt tên:</Text>
                <Text>Không vi phạm Quy định đặt tên trên Zalo</Text>
                <Text>Nên sử dụng tên thật để giúp bạn bè dễ nhận ra bạn</Text>
                </View>
        </View>
    )
};
export default CreateAccount;
